import React, { Component } from "react";
import SHOP_DATA from "./shop-data";

class Shop extends Component {
  constructor(props) {
    super(props);
    this.state = SHOP_DATA;
  }
  render() {
    return (
      <div>
        <h1>Shop</h1>
      </div>
    );
  }
}

export default Shop;
